class ProjectHistoryCommentResponseModel {  List<ProjectHistoryCommentModel>? data;  ProjectHistoryCommentResponseModel({this.data});  ProjectHistoryCommentResponseModel.fromJson(List<dynamic>? json) {    if (json != null) {      data = <ProjectHistoryCommentModel>[];      json.forEach((v) {        data!.add(new ProjectHistoryCommentModel.fromJson(v));      });    }  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    if (this.data != null) {      data['Data'] = this.data!.map((v) => v.toJson()).toList();    }    return data;  }}class ProjectHistoryCommentModel {  int? manageProjectHistoryId;  int? manageProjectId;  int? staffId;  String? staffName;  String? staffAvatar;  String? message;  String? createdAt;  int? createdBy;  String? updatedAt;  int? updatedBy;  String? actionType;  String? comment;  String? path;  ProjectHistoryCommentModel(      {this.manageProjectHistoryId,        this.manageProjectId,        this.staffId,        this.staffName,        this.staffAvatar,        this.message,        this.createdAt,        this.createdBy,        this.updatedAt,        this.updatedBy,        this.actionType,        this.comment, this.path});  ProjectHistoryCommentModel.fromJson(Map<String, dynamic> json) {    manageProjectHistoryId = json['manage_project_history_id'];    manageProjectId = json['manage_project_id'];    staffId = json['staff_id'];    staffName = json['staff_name'];    staffAvatar = json['staff_avatar'];    message = json['message'];    createdAt = json['created_at'];    createdBy = json['created_by'];    updatedAt = json['updated_at'];    updatedBy = json['updated_by'];    actionType = json['action_type'];    comment = json['comment'];    path = json['path'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_history_id'] = this.manageProjectHistoryId;    data['manage_project_id'] = this.manageProjectId;    data['staff_id'] = this.staffId;    data['staff_name'] = this.staffName;    data['staff_avatar'] = this.staffAvatar;    data['message'] = this.message;    data['created_at'] = this.createdAt;    data['created_by'] = this.createdBy;    data['updated_at'] = this.updatedAt;    data['updated_by'] = this.updatedBy;    data['action_type'] = this.actionType;    data['comment'] = this.comment;    data['path'] = this.path;    return data;  }}